SELECT @id := idStockMensual FROM stock_aves_mensual WHERE idLote = Lt and Year = y and Month = m;

SELECT @idFirst := idStockMensual FROM stock_aves_mensual WHERE idLote = Lt LIMIT 1;

IF(LOCATE(',', @myArrayOfValue) = 0) THEN

    SELECT @NroAvesIniciadas := NroAvesIniciadas FROM stock_aves_mensual WHERE idStockMensual = @id;
    
    SET @ym = CONCAT(y,'-',@mes1);

    SELECT @Cant_Ingreso := IFNULL(SUM(Cant_Ingreso),0) FROM traslado_ingreso_ventas WHERE idLoteDestino = Lt and Fecha LIKE CONCAT('%',@ym,'%');
    
    SELECT @Traslado := IFNULL(SUM(Traslado),0) FROM traslado_ingreso_ventas WHERE idLoteOrigen = Lt and Fecha LIKE CONCAT('%',@ym,'%');
    
    SELECT @FinCampania := IFNULL(SUM(Venta),0)  as Venta FROM traslado_ingreso_ventas WHERE idLoteOrigen = Lt and Fecha LIKE CONCAT('%',@ym,'%');
    
    SET @Ingreso = @Cant_Ingreso - @Traslado;

    SELECT @Mortalidad := SUM(NoAves), @Descartes := SUM(NoEliminados) FROM mortalidad_det WHERE idLote = Lt and fecha LIKE CONCAT('%',@ym,'%');
    
    SET @NroAvesFinal = @NroAvesIniciadas - @Mortalidad - @Descartes - @FinCampania + @Ingreso;
    
    UPDATE stock_aves_mensual SET Mortalidad = @Mortalidad, Descarte = @Descartes, FinCampania = @FinCampania, Ingreso = @Ingreso, NroAvesFinal = @NroAvesFinal WHERE idStockMensual = @id;

ELSE

    WHILE (LOCATE(',', @myArrayOfValue) > 0) DO

        SET @value = ELT(1, @myArrayOfValue);

        SELECT @Mes_Actual := Month, @Year_Actual := Year FROM stock_aves_mensual WHERE idStockMensual = @value;

        SET @ym = CONCAT(@Year_Actual,'-',@Mes_Actual);

        IF(@Mes_Actual = '01') THEN

            set @year_ant = @Year_Actual - 1;
            set @month_ant = 12;

        ELSE

            set @year_ant = @Year_Actual;
            set @month_ant = @Mes_Actual - 1;

        END IF;

        IF(@month_ant < 10) THEN

            set @month_ant = CONCAT('0',@month_ant);

        END IF;

        IF (@id = @value) THEN

            SELECT @Cant_Ingreso := IFNULL(SUM(Cant_Ingreso),0) FROM traslado_ingreso_ventas WHERE idLoteDestino = Lt and Fecha LIKE CONCAT('%',@ym,'%');
            
            SELECT @Traslado := IFNULL(SUM(Traslado),0) FROM traslado_ingreso_ventas WHERE idLoteOrigen = Lt and Fecha LIKE CONCAT('%',@ym,'%');
            
            SELECT @FinCampania := IFNULL(SUM(Venta),0)  as Venta FROM traslado_ingreso_ventas WHERE idLoteOrigen = Lt and Fecha LIKE CONCAT('%',@ym,'%');
            
            SET @Ingreso = @Cant_Ingreso - @Traslado;

            SELECT @Mortalidad := SUM(NoAves), @Descartes := SUM(NoEliminados) FROM mortalidad_det WHERE idLote = Lt and fecha LIKE CONCAT('%',@ym,'%');

            IF (@id = @idFirst) THEN

                SELECT @NroAvesIniciadas := NroAvesIniciadas FROM stock_aves_mensual WHERE idStockMensual = @id;
                
                SET @NroAvesFinal = @NroAvesIniciadas - @Mortalidad - @Descartes - @FinCampania + @Ingreso;
                
                UPDATE stock_aves_mensual SET Mortalidad = @Mortalidad, Descarte = @Descartes, FinCampania = @FinCampania, Ingreso = @Ingreso, NroAvesFinal = @NroAvesFinal WHERE idStockMensual = @id;

            ELSE

                SELECT @NroAvesIniciadas := NroAvesFinal FROM stock_aves_mensual WHERE idLote = Lt and Year = @year_ant and Month = @month_ant;
                
                SET @NroAvesFinal = @NroAvesIniciadas - @Mortalidad - @Descartes - @FinCampania + @Ingreso;
                
                UPDATE stock_aves_mensual SET NroAvesIniciadas = @NroAvesIniciadas, Mortalidad = @Mortalidad, Descarte = @Descartes, FinCampania = @FinCampania, Ingreso = @Ingreso, NroAvesFinal = @NroAvesFinal WHERE idStockMensual = @id;

            END IF;
            
        ELSE

            SELECT @Mortalidad := Mortalidad, @Descartes := Descarte, @FinCampania := Fincampania, @Ingreso := Ingreso FROM stock_aves_mensual WHERE idStockMensual = @value;

            IF (@value = @idFirst) THEN

                SELECT @NroAvesIniciadas := NroAvesIniciadas FROM stock_aves_mensual WHERE idStockMensual = @value;

                SET @NroAvesFinal = @NroAvesIniciadas - @Mortalidad - @Descartes - @FinCampania + @Ingreso;

                UPDATE stock_aves_mensual SET NroAvesFinal = @NroAvesFinal WHERE idStockMensual = @value;

            ELSE

                SELECT @NroAvesIniciadas := NroAvesFinal FROM stock_aves_mensual WHERE idLote = Lt and Year = @year_ant and Month = @month_ant;
                
                SET @NroAvesFinal = @NroAvesIniciadas - @Mortalidad - @Descartes - @FinCampania + @Ingreso;
                
                UPDATE stock_aves_mensual SET NroAvesIniciadas = @NroAvesIniciadas, NroAvesFinal = @NroAvesFinal WHERE idStockMensual = @value;

            END IF;
        
        END IF;

        SET @myArrayOfValue= SUBSTRING(@myArrayOfValue, LOCATE(',',@myArrayOfValue) + 1);

    END WHILE;

END IF;

END ;;
DELIMITER ;
