CREATE DEFINER=`root`@`localhost` PROCEDURE `getActualizarAlimentoLevante`(IN `p1` INT, IN `p2` INT)
BEGIN

SELECT @SemTotal := MAX(`Semana`) FROM `alimento_levante_sem` WHERE `idLevante`=p1 AND `idLote` = p2;

set @i = 1;
set @Total = 0;


while @i<= @SemTotal  do

    IF (@i = 1) THEN

        SELECT @mycount1 := SUM(`CantAlimento`) FROM `alimento_levante_det` WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana` = @i;

        UPDATE `alimento_levante_sem` SET `CantAcumAlimento` = @mycount1, `CantAlimentoSem` = @mycount1 WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana` = @i;

    ELSE
        SELECT @mycount3 := SUM(`CantAlimento`) FROM `alimento_levante_det` WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana`= @i;

        UPDATE `alimento_levante_sem` SET `CantAlimentoSem` = @mycount3 WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana` = @i;

        SELECT @mycount2 := SUM(`CantAlimentoSem`) FROM `alimento_levante_sem` WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana` <= @i;

        UPDATE `alimento_levante_sem` SET `CantAcumAlimento` = @mycount2 WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana` = @i;

    END IF;

    SELECT @Saldo := IFNULL((SELECT saldo_fin_sem FROM `mortalidadsem` WHERE idLevante = p1 and idLote = p2 And Semana= @i),0);

    SELECT @CantAlimSemanal := CantAlimentoSem FROM `alimento_levante_sem` WHERE idLevante = p1 and idLote = p2 And Semana= @i;

    SET @OperacionTotal = 0;

    IF (@Saldo != 0) THEN

        SET @OperacionTotal = ROUND((((@CantAlimSemanal/@Saldo)/7)*1000),2);       

    END IF;

    UPDATE `alimento_levante_sem` SET `CantRealAlimento` = @OperacionTotal WHERE `idLevante`= p1 AND `idLote` = p2 and `Semana` = @i;

    IF (@i = 1) THEN

        UPDATE `alimento_levante_sem` SET `CantIncreAlimento` = 0 WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana` = @i;

    ELSE

        IF (@OperacionTotal = 0) THEN

            SET @TOTALIncremento = 0;

            UPDATE `alimento_levante_sem` SET `CantIncreAlimento` = @TOTALIncremento WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana` = @i;

        ELSE

            SET @iMenos = @i - 1;

            Select @incremento3 := `CantRealAlimento` FROM `alimento_levante_sem` WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @iMenos;

            SET @TOTALIncremento = @OperacionTotal - @incremento3;

            UPDATE `alimento_levante_sem` SET `CantIncreAlimento` = @TOTALIncremento WHERE `idLevante`=p1 AND `idLote` = p2 and `Semana` = @i;

        END IF;

    END IF;


    set @i=@i+1;

end while;

END ;;
DELIMITER ;
