CREATE DEFINER=`root`@`localhost` PROCEDURE `getActualizarAlimentoProduccion`(IN `p1` INT, IN `p2` INT)
    NO SQL
BEGIN

SELECT @SemTotal := MAX(`Semana`) FROM `alimento_prod_sem` WHERE `idProduccion`=p1 AND `idLote` = p2;

set @i = 1;
set @Total = 0;


while @i<= @SemTotal  do

    IF (@i = 1) THEN

        SELECT @mycount1 := SUM(`CantAlimento`) FROM `alimento_prod_det` WHERE `idProduccion`=p1 AND `idLote` = p2 and `semana_prod` = @i;

        UPDATE `alimento_prod_sem` SET `CantAcumAlimento` = @mycount1, `CantAlimentoSem` = @mycount1 WHERE `idProduccion`=p1 AND `idLote` = p2 and `Semana` = @i;

    ELSE
        SELECT @mycount3 := SUM(`CantAlimento`) FROM `alimento_prod_det` WHERE `idProduccion`=p1 AND `idLote` = p2 and `semana_prod`= @i;

        UPDATE `alimento_prod_sem` SET `CantAlimentoSem` = @mycount3 WHERE `idProduccion`=p1 AND `idLote` = p2 and `Semana` = @i;

        SELECT @mycount2 := SUM(`CantAlimentoSem`) FROM `alimento_prod_sem` WHERE `idProduccion`=p1 AND `idLote` = p2 and `Semana` <= @i;

        UPDATE `alimento_prod_sem` SET `CantAcumAlimento` = @mycount2 WHERE `idProduccion`=p1 AND `idLote` = p2 and `Semana` = @i;

    END IF;

    SELECT @Saldo := IFNULL((SELECT saldo_fin_sem FROM `mortalidad_prod_sem` WHERE idProduccion = p1 and idLote = p2 And semana_prod= @i),0);

    SELECT @CantAlimSemanal := CantAlimentoSem FROM `alimento_prod_sem` WHERE idProduccion = p1 and idLote = p2 And Semana= @i;

    SET @OperacionTotal_ant = 0;
    
    IF (@i != 1) THEN
   
        SELECT @Saldo_ant := IFNULL((SELECT saldo_fin_sem FROM `mortalidad_prod_sem` WHERE idProduccion = p1 and idLote = p2 And semana_prod= (@i-1)),0);

        SELECT @CantAlimSemanal_ant := CantAlimentoSem FROM `alimento_prod_sem` WHERE idProduccion = p1 and idLote = p2 And Semana= (@i-1);

        IF (@Saldo_ant != 0) THEN

            SET @OperacionTotal_ant = ROUND((((@CantAlimSemanal_ant/@Saldo_ant )/7)*1000),2);       

        END IF;

    END IF;

    SET @OperacionTotal = 0;

    IF (@Saldo != 0) THEN

        SET @OperacionTotal = ROUND((((@CantAlimSemanal/@Saldo)/7)*1000),2);       

    END IF;
    
    IF (@i = 1) THEN

       UPDATE `alimento_prod_sem` SET `Ave_Dia_Gr` = @OperacionTotal, `gramos` = @OperacionTotal, `Increm_gramos` = 0 WHERE `idProduccion`= p1 AND `idLote` = p2 and `Semana` = @i;

    ELSE
    
		set @Inc_gr = 0;
    
		IF (@Saldo_ant != 0) THEN

			set @Inc_gr = @OperacionTotal - @OperacionTotal_ant;  

        END IF;

       UPDATE `alimento_prod_sem` SET `Ave_Dia_Gr` = @OperacionTotal, `gramos` = @OperacionTotal, `Increm_gramos` = @Inc_gr WHERE `idProduccion`= p1 AND `idLote` = p2 and `Semana` = @i;

    END IF;

    set @i=@i+1;

end while;

END ;;
DELIMITER ;
