CREATE DEFINER=`root`@`localhost` PROCEDURE `getActualizarPesoLevante`(IN `p1` INT, IN `p2` INT)
BEGIN

  
  SELECT @SemTotal := MAX(`Semana`) FROM `peso_semana_det` WHERE `idLevante`=p1 AND `idLote` = p2;

  set @i = 1;
  set @Total = 0;

  while @i<= @SemTotal  do
  	
      IF (@i = 1) THEN
      
      	Select @ganancia1 := `peso_actual` FROM `peso_semana_det` WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @i;
      
      	UPDATE `peso_semana_det` SET `ganancia_real` = @ganancia1 WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @i;
        
        UPDATE `peso_semana_det` SET `ganancia_std` = 0 WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @i;
      
      ELSE
      
      	Select @ganancia2 := `peso_actual` FROM `peso_semana_det` WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @i;
        
        set @iMenos = @i - 1;
        
        Select @ganancia3 := `peso_actual` FROM `peso_semana_det` WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @iMenos;
        
        set @gananciaTotal = @ganancia2 - @ganancia3;
        
        UPDATE `peso_semana_det` SET `ganancia_real` = @gananciaTotal WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @i;
        
        SELECT @Std2 := `peso_standard` FROM `peso_semana_det` WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @i;
        
        SELECT @Std3 := `peso_standard` FROM `peso_semana_det` WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @iMenos;
        
        set @gananciaStd = @Std2 - @Std3;
        
        UPDATE `peso_semana_det` SET `ganancia_std` = @gananciaStd WHERE `idLevante`=p1 AND `idLote` = p2 AND `Semana`= @i;
      
      END IF;
      
  set @i=@i+1;

  end while;
 
END ;;
DELIMITER ;
