DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getActualizarSaldoMortalidadSem`(IN `p1` INT, IN `p2` INT, IN `p3` INT)
    NO SQL
BEGIN

SELECT @SemTotal := MAX(`Semana`) FROM `mortalidadsem` WHERE `idLevante`=p1 AND `idLote` = p2;

set @i = p3;

while @i<= @SemTotal  do

    IF (@i = 1) THEN

        SELECT @Num_Hembras := NumHembras FROM `lotes` WHERE `idLevante`= p1 AND `idLote` = p2;
        SELECT @MortalidadTot:= MortalidadTot, @SelGen := SelGen,
        @ErSex := ErSex FROM `mortalidadsem` WHERE `idLevante`= p1 AND `idLote` = p2 AND `Semana` = @i;
        set @SaldoFS = @Num_Hembras - @MortalidadTot - @ErSex - @SelGen;
        set @PorcMortalidadTot = ( @MortalidadTot / (@Num_Hembras - @MortalidadTot) )*100;
        UPDATE `mortalidadsem` SET `saldo_fin_sem` = @SaldoFS, `PorcMortalidadTot` = ROUND(@PorcMortalidadTot, 2) WHERE `idLevante`= p1 AND `idLote` = p2 AND `Semana` = @i;

    ELSE

        SELECT @saldo_fim_sem := saldo_fin_sem FROM `mortalidadsem` WHERE `idLevante`= p1 AND `idLote` = p2 and `Semana` = @i-1;
        SELECT @MortalidadTot:= MortalidadTot, @SelGen := SelGen,
        @ErSex := ErSex FROM `mortalidadsem` WHERE `idLevante`= p1 AND `idLote` = p2 AND `Semana` = @i;
        SELECT @MortalidadTot_ant := PorcMortalidadTot FROM `mortalidadsem` WHERE `idLevante`= p1 AND `idLote` = p2 AND `Semana` = (@i-1);
        set @SaldoFS = @saldo_fim_sem - @MortalidadTot - @ErSex - @SelGen;
        set @PorcMortalidadTot = (( @MortalidadTot / (@saldo_fim_sem - @MortalidadTot) )*100)+@MortalidadTot_ant;
        UPDATE `mortalidadsem` SET `saldo_fin_sem` = @SaldoFS, `PorcMortalidadTot` = ROUND(@PorcMortalidadTot, 2) WHERE `idLevante`= p1 AND `idLote` = p2 AND `Semana` = @i;

    END IF;

    set @i=@i+1;

end while;

END ;;
DELIMITER ;
