CREATE DEFINER=`root`@`localhost` PROCEDURE `getActualizarSaldoMortalidadSemProd`(IN `p1` INT, IN `p2` INT, IN `p3` INT)
    NO SQL
BEGIN

SELECT @SemTotal := MAX(`semana_prod`) FROM `mortalidad_prod_sem` WHERE `idProduccion`=p1 AND `idLote` = p2;

set @i = p3;

while @i<= @SemTotal  do

    IF (@i = 1) THEN

        SELECT @Num_Hembras := Num_Aves_Fin_Levante FROM `lotes` WHERE `idProduccion`= p1 AND `idLote` = p2;
        SELECT @MortalidadTot:= MortalidadTot FROM `mortalidad_prod_sem` WHERE `idProduccion`= p1 AND `idLote` = p2 AND `semana_prod` = @i;
        set @SaldoFS = @Num_Hembras - @MortalidadTot;
        set @PorcMortalidadTot = ( @MortalidadTot / @SaldoFS )*100;
        UPDATE `mortalidad_prod_sem` SET `saldo_fin_sem` = @SaldoFS, `PorcMortalidadTot` = ROUND(@PorcMortalidadTot, 2) WHERE `idProduccion`= p1 AND `idLote` = p2 AND `semana_prod` = @i;

    ELSE

        SELECT @saldo_fim_sem := saldo_fin_sem FROM `mortalidad_prod_sem` WHERE `idProduccion`= p1 AND `idLote` = p2 and `semana_prod` = @i-1;
        SELECT @MortalidadTot:= MortalidadTot FROM `mortalidad_prod_sem` WHERE `idProduccion`= p1 AND `idLote` = p2 AND `semana_prod` = @i;
        set @SaldoFS = @saldo_fim_sem - @MortalidadTot;
        set @PorcMortalidadTot = ( @MortalidadTot / @SaldoFS )*100;
        UPDATE `mortalidad_prod_sem` SET `saldo_fin_sem` = @SaldoFS, `PorcMortalidadTot` = ROUND(@PorcMortalidadTot, 2) WHERE `idProduccion`= p1 AND `idLote` = p2 AND `semana_prod` = @i;

    END IF;

    set @i=@i+1;

end while;

END ;;
