CREATE DEFINER=`root`@`localhost` PROCEDURE `getinsertarSTDPesoLevante`(IN `p1` INT, IN `p2` INT)
BEGIN

CASE p1
WHEN 19 THEN SELECT PesoH_L9 AS StdData FROM standard_levante WHERE Semana = p2;
WHEN 17 THEN SELECT PesoH_L4 AS StdData FROM standard_levante WHERE Semana = p2;
WHEN 18 THEN SELECT PesoM_L7 AS StdData FROM standard_levante WHERE Semana = p2;
WHEN 1 THEN SELECT PesoM_L1 AS StdData FROM standard_levante WHERE Semana = p2;
ELSE SELECT 4 AS StdData;
END CASE;
 
END ;;
