CREATE DEFINER=`root`@`localhost` PROCEDURE `getSemanalAlimentoLevante`(IN `p1` INT, IN `p2` INT, IN `p3` INT, IN `p4` INT, IN `p5` INT)
BEGIN
SELECT @mycount := COUNT(*) FROM `alimento_levante_sem` as al_lev_sem WHERE al_lev_sem.`idLevante`= p1 AND al_lev_sem.`idLote` = p3 and al_lev_sem.`Semana` = p2;

IF (@mycount = 0) THEN

    IF (p2 = 1) THEN
        IF (p4 = 0) THEN
            INSERT INTO `alimento_levante_sem`
            (`idLevante`, `idLote`, `Semana`, `CantAlimentoSem`, `CantAcumAlimento`, `STD`,`eliminEstado`) 
            SELECT 
            `idLevante`, 
            `idLote`, 
            `Semana`, 
            SUM(`CantAlimento`), 
            SUM(`CantAlimento`), 
            p5,
            0
            FROM `alimento_levante_det` 
            INNER JOIN `tipo_alimento` ta on ta.idAlimento = alimento_levante_det.idAlimento
            WHERE `idLevante`= p1 
            and `Semana`= p2 
            and `idLote`= p3;
        ELSE
            INSERT INTO `alimento_levante_sem`
            (`idLevante`, `idLote`, `Semana`, `CantAlimentoSem`, `CantAcumAlimento`, `STD`,`eliminEstado`, `descripAlimento`) 
            SELECT 
            `idLevante`, 
            `idLote`, 
            `Semana`, 
            SUM(`CantAlimento`), 
            SUM(`CantAlimento`), 
            p5,
            0,
            ta.`nombreAlimento`   
            FROM `alimento_levante_det` 
            INNER JOIN `tipo_alimento` ta on ta.idAlimento = alimento_levante_det.idAlimento
            WHERE `idLevante`= p1 
            and `Semana`= p2 
            and `idLote`= p3;
        END IF;
    ELSE
        SELECT @std := STD from alimento_levante_sem WHERE `idLevante` = p1 and `Semana` = (p2-1) and `idLote`=p3;
        set @stdTot = p5 - @std;
        IF (p4 = 0) THEN
            INSERT INTO `alimento_levante_sem`
            (`idLevante`, `idLote`, `Semana`, `CantAlimentoSem`, `CantAcumAlimento`, `STD`, `CantIncreSTD`, `eliminEstado`) 
            SELECT 
            `idLevante`, 
            `idLote`, 
            `Semana`, 
            SUM(`CantAlimento`), 
            SUM(`CantAlimento`), 
            p5,
            @stdTot,
            0
            FROM `alimento_levante_det` 
            INNER JOIN `tipo_alimento` ta on ta.idAlimento = alimento_levante_det.idAlimento
            WHERE `idLevante`= p1 
            and `Semana`= p2 
            and `idLote`= p3;
        ELSE
            INSERT INTO `alimento_levante_sem`
            (`idLevante`, `idLote`, `Semana`, `CantAlimentoSem`, `CantAcumAlimento`, `STD`, `CantIncreSTD`, `eliminEstado`, `descripAlimento`) 
            SELECT 
            `idLevante`, 
            `idLote`, 
            `Semana`, 
            SUM(`CantAlimento`), 
            SUM(`CantAlimento`), 
            p5,
            @stdTot,
            0,
            ta.`nombreAlimento`   
            FROM `alimento_levante_det` 
            INNER JOIN `tipo_alimento` ta on ta.idAlimento = alimento_levante_det.idAlimento
            WHERE `idLevante`= p1 
            and `Semana`= p2 
            and `idLote`= p3;
        END IF;
    END IF;
ELSE
     UPDATE `alimento_levante_sem`
     SET `CantAlimentoSem` = (SELECT SUM(`CantAlimento`)
     FROM `alimento_levante_det` WHERE `idLevante` = p1 
     and `Semana` = p2 and `idLote`= p3),
     `CantAcumAlimento` = (SELECT SUM(`CantAlimento`)
     FROM `alimento_levante_det` WHERE `idLevante` = p1 
     and `Semana` = p2 and `idLote`= p3),
     `descripAlimento` = (SELECT GROUP_CONCAT(DISTINCT ta.`nombreAlimento` ORDER BY ald.`idAlimentoLevante` asc SEPARATOR '/') FROM
     `alimento_levante_det` ald INNER JOIN `tipo_alimento` ta on ta.idAlimento = ald.idAlimento WHERE ald.`idLevante` = p1 and ald.`Semana` = p2 and ald.`idLote`= p3 and ald.`CantAlimento` != 0 GROUP BY idLote)
     WHERE `idLevante` = p1 
     and `Semana` = p2
     and `idLote`=p3;
END IF; 
END ;;
DELIMITER ;
