CREATE DEFINER=`root`@`localhost` PROCEDURE `refreshStockDiarioHI`(IN `p1` INT, IN `p2` INT, IN `p3` INT)
    NO SQL
BEGIN

SELECT  @SemTotal := MAX(`Edad`) FROM `stock_diario_hi` WHERE `idLote` = p1;

set @i = p2;

while @i<= @SemTotal  do

	IF (@i = p2) THEN
    
    	SELECT @saldoFinTipoA := saldoFinTipoA, @saldoFinTipoB := saldoFinTipoB, @saldoFinTipoB1 := saldoFinTipoB1, @saldoFinTipoC := saldoFinTipoC FROM stock_diario_hi WHERE idLote = p1 and Edad = @i;
    	
        UPDATE stock_diario_hi SET salidasTipoA = @saldoFinTipoA, saldoFinTipoA = 0, salidasTipoB = @saldoFinTipoB, saldoFinTipoB = 0, salidasTipoB1 = @saldoFinTipoB1, saldoFinTipoB1 = 0, salidasTipoC = @saldoFinTipoC, saldoFinTipoC = 0, numeroGuia = p3 WHERE idLote = p1 and Edad = @i;
        
    ELSE
    
    	SELECT @saldoFinTipoA_ant := saldoFinTipoA, @saldoFinTipoB_ant := saldoFinTipoB, @saldoFinTipoB1_ant := saldoFinTipoB1, @saldoFinTipoC_ant := saldoFinTipoC FROM stock_diario_hi WHERE idLote = p1 and Edad =@i-1;
        
        SELECT @ingresosTipoA := ingresosTipoA, @ingresosTipoB := ingresosTipoB, @ingresosTipoB1 := ingresosTipoB1, @ingresosTipoC := ingresosTipoC FROM stock_diario_hi WHERE idLote = p1 and Edad = @i;
        
        set @saldoFinTipoA = @saldoFinTipoA_ant + @ingresosTipoA;
        set @saldoFinTipoB = @saldoFinTipoB_ant + @ingresosTipoB;
        set @saldoFinTipoB1 = @saldoFinTipoB1_ant + @ingresosTipoB1;
        set @saldoFinTipoC = @saldoFinTipoC_ant + @ingresosTipoC;
        
        UPDATE stock_diario_hi SET saldoIniTipoA = @saldoFinTipoA_ant,  saldoIniTipoB = @saldoFinTipoB_ant,  saldoIniTipoB1 = @saldoFinTipoB1_ant,  saldoIniTipoC = @saldoFinTipoC_ant, saldoFinTipoA = @saldoFinTipoA,  saldoFinTipoB = @saldoFinTipoB,  saldoFinTipoB1 = @saldoFinTipoB1,  saldoFinTipoC = @saldoFinTipoC WHERE idLote = p1 and Edad = @i;
    
    END IF;

    set @i=@i+1;

end while;


END ;;
DELIMITER ;
