CREATE DEFINER=`root`@`localhost` PROCEDURE `refreshStockMensualHC`(IN `p1` INT, IN `p2` INT, IN `p3` INT, IN `p4` VARCHAR(50), IN `p5` INT, IN `p6` INT)
    NO SQL
BEGIN

SELECT @myArrayOfValue := GROUP_CONCAT(idStockMensualHC) FROM `stock_mensual_hc` WHERE `idLote` = p1;

SELECT @idFirst := `idStockMensualHC` FROM `stock_mensual_hc` WHERE `idLote` = p1  LIMIT 1;

SELECT @id := `idStockMensualHC` FROM `stock_mensual_hc` WHERE `idLote` = p1 and `year` = p2 and `month` = p3;

IF(LOCATE(',', @myArrayOfValue) = 0) THEN

    SELECT @salidasTipoNormal := salidasTipoNormal, @saldoFinTipoNormal := saldoFinTipoNormal, @salidasTipoDY := salidasTipoDY, @saldoFinTipoDY := saldoFinTipoDY FROM stock_mensual_hc where year = p2 and month = p3 and idLote = p1;

set @salidasTipoNormal = @salidasTipoNormal + p5;
set @saldoFinTipoNormal = @saldoFinTipoNormal - p5;

set @salidasTipoDY = @salidasTipoDY + p6;
set @saldoFinTipoDY = @saldoFinTipoDY - p6;

UPDATE stock_mensual_hc set salidasTipoNormal = @salidasTipoNormal , saldoFinTipoNormal  = @saldoFinTipoNormal , salidasTipoDY  = @salidasTipoDY , saldoFinTipoDY = @saldoFinTipoDY WHERE idStockMensualHC = @id;

ELSE

WHILE (LOCATE(',', @myArrayOfValue) > 0) DO

    SET @value = ELT(1, @myArrayOfValue);

    IF( @id = @value ) THEN

        IF ( @id = @idFirst ) THEN

            SELECT @saldoIniTipoNormal := 0, @ingresosTipoNormal := ingresosTipoNormal, @salidasTipoNormal := salidasTipoNormal,
            @saldoIniTipoDY := 0, @ingresosTipoDY := ingresosTipoDY, @salidasTipoDY:= salidasTipoDY FROM `stock_mensual_hc` 
WHERE idStockMensualHC= @id;

        ELSE

            SELECT @saldoIniTipoNormal := saldoIniTipoNormal, @ingresosTipoNormal := ingresosTipoNormal, @salidasTipoNormal := salidasTipoNormal,
            @saldoIniTipoDY := saldoIniTipoDY, @ingresosTipoDY := ingresosTipoDY, @salidasTipoDY := salidasTipoDY FROM `stock_mensual_hc` WHERE idStockMensualHC= @id;

        END IF;

        set @saldoFinTipoNormal = @saldoIniTipoNormal + @ingresosTipoNormal - @salidasTipoNormal;
        set @saldoFinTipoDY = @saldoIniTipoDY + @ingresosTipoDY - @salidasTipoDY;

        UPDATE stock_mensual_hc set 
        saldoIniTipoNormal = @saldoIniTipoNormal, ingresosTipoNormal = @ingresosTipoNormal, salidasTipoNormal = @salidasTipoNormal, saldoFinTipoNormal  = @saldoFinTipoNormal,
        saldoIniTipoDY = @saldoIniTipoDY, ingresosTipoDY = @ingresosTipoDY, salidasTipoDY = @salidasTipoDY, saldoFinTipoDY  = @saldoFinTipoDY
        WHERE idStockMensualHC= @id;

    ELSE
        IF(p3 = 1) THEN

            set @year_ant = p2 - 1;
            set @month_ant = 12;

        ELSE

            set @year_ant = p2;
            set @month_ant = p3 - 1;

        END IF;

        IF(p3 < 10) THEN

            set @ym_ant = CONCAT(@year_ant,'-0',@month_ant);

        ELSE

            set @ym_ant = CONCAT(@year_ant,'-',@month_ant);

        END IF;

        SELECT @saldoFinTipoNormal_ant := saldoFinTipoNormal,
        @saldoFinTipoDY_ant := saldoFinTipoDY 
        FROM `stock_mensual_hc` WHERE idLote = p1 and fechaRegistro LIKE CONCAT('%',@ym_ant,'%');

        SELECT @ingresosTipoNormal := ingresosTipoNormal, @salidasTipoNormal := salidasTipoNormal,
        @ingresosTipoDY := ingresosTipoDY, @salidasTipoDY:= salidasTipoDY 
        FROM `stock_mensual_hc` WHERE idLote = p1 and fechaRegistro LIKE CONCAT('%',@ym,'%');        

        set @saldoFinTipoNormal = @saldoFinTipoNormal_ant + @ingresosTipoNormal - @salidasTipoNormal;
        set @saldoFinTipoDY = @saldoFinTipoDY_ant + @ingresosTipoDY - @salidasTipoDY;
        
        UPDATE stock_mensual_hc set 
        saldoIniTipoNormal = @saldoFinTipoNormal_ant, ingresosTipoNormal = @ingresosTipoNormal, salidasTipoNormal = @salidasTipoNormal, saldoFinTipoNormal = @saldoFinTipoNormal,
        saldoIniTipoDY = @saldoFinTipoDY_ant, ingresosTipoDY = @ingresosTipoDY, salidasTipoDY = @salidasTipoDY, saldoFinTipoDY = @saldoFinTipoDY
        WHERE idStockMensualHC = @value;

    END IF;

    SET @myArrayOfValue= SUBSTRING(@myArrayOfValue, LOCATE(',',@myArrayOfValue) + 1);

END WHILE;

END IF;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
