        saldoIniTipoC = @saldoIniTipoC, ingresosTipoC = @ingresosTipoC, salidasTipoC = @salidasTipoC, saldoFinTipoC  = @saldoFinTipoC
        WHERE idStockMensualHI = @id;

ELSE

WHILE (LOCATE(',', @myArrayOfValue) > 0) DO

    SET @value = ELT(1, @myArrayOfValue);

    IF( @id = @value ) THEN

        IF ( @id = @idFirst ) THEN

            SELECT @saldoIniTipoA := 0, @ingresosTipoA := SUM(ingresosTipoA), @salidasTipoA := SUM(salidasTipoA),
            @saldoIniTipoB := 0, @ingresosTipoB := SUM(ingresosTipoB), @salidasTipoB := SUM(salidasTipoB),
            @saldoIniTipoB1 := 0, @ingresosTipoB1 := SUM(ingresosTipoB1), @salidasTipoB1 := SUM(salidasTipoB1),
            @saldoIniTipoC := 0, @ingresosTipoC := SUM(ingresosTipoC), @salidasTipoc:= SUM(salidasTipoc) FROM `stock_diario_hi` WHERE idLote = p1 and fechaRegistro LIKE CONCAT('%',@ym,'%');

        ELSE

            SELECT @saldoIniTipoA := SUM(saldoIniTipoA), @ingresosTipoA := SUM(ingresosTipoA), @salidasTipoA := SUM(salidasTipoA),
            @saldoIniTipoB := SUM(saldoIniTipoB), @ingresosTipoB := SUM(ingresosTipoB), @salidasTipoB := SUM(salidasTipoB),
            @saldoIniTipoB1 := SUM(saldoIniTipoB1), @ingresosTipoB1 := SUM(ingresosTipoB1), @salidasTipoB1 := SUM(salidasTipoB1),
            @saldoIniTipoC := SUM(saldoIniTipoC), @ingresosTipoC := SUM(ingresosTipoC), @salidasTipoc:= SUM(salidasTipoc) FROM `stock_diario_hi` WHERE idLote = p1 and fechaRegistro LIKE CONCAT('%',@ym,'%');

        END IF;

        set @saldoFinTipoA = @saldoIniTipoA + @ingresosTipoA - @salidasTipoA;
        set @saldoFinTipoB = @saldoIniTipoB + @ingresosTipoB - @salidasTipoB;
        set @saldoFinTipoB1 = @saldoIniTipoB1 + @ingresosTipoB1 - @salidasTipoB1;
        set @saldoFinTipoC = @saldoIniTipoC + @ingresosTipoC - @salidasTipoC;

        UPDATE stock_mensual_hi set 
        saldoIniTipoA = @saldoIniTipoA, ingresosTipoA = @ingresosTipoA, salidasTipoA = @salidasTipoA, saldoFinTipoA  = @saldoFinTipoA,
        saldoIniTipoB = @saldoIniTipoB, ingresosTipoB = @ingresosTipoB, salidasTipoB = @salidasTipoB, saldoFinTipoB  = @saldoFinTipoB,
        saldoIniTipoB1 = @saldoIniTipoB1, ingresosTipoB1 = @ingresosTipoB1, salidasTipoB1 = @salidasTipoB1, saldoFinTipoB1  = @saldoFinTipoB1,
        saldoIniTipoC = @saldoIniTipoC, ingresosTipoC = @ingresosTipoC, salidasTipoC = @salidasTipoC, saldoFinTipoC  = @saldoFinTipoC
        WHERE idStockMensualHI = @id;

    ELSE
        IF(@month = 1) THEN

            set @year_ant = @year - 1;
            set @month_ant = 12;

        ELSE

            set @year_ant = @year;
            set @month_ant = @month - 1;

        END IF;

        IF(@month < 10) THEN

            set @ym_ant = CONCAT(@year_ant,'-0',@month_ant);

        ELSE

            set @ym_ant = CONCAT(@year_ant,'-',@month_ant);

        END IF;

        SELECT @saldoFinTipoA_ant := saldoFinTipoA,
        @saldoFinTipoB_ant := saldoFinTipoB,
        @saldoFinTipoB1_ant := saldoFinTipoB1,
        @saldoFinTipoC_ant := saldoFinTipoC 
        FROM `stock_mensual_hi` WHERE idLote = p1 and fechaRegistro LIKE CONCAT('%',@ym_ant,'%');

        SELECT @ingresosTipoA := ingresosTipoA, @salidasTipoA := salidasTipoA,
        @ingresosTipoB := ingresosTipoB, @salidasTipoB := salidasTipoB,
        @ingresosTipoB1 := ingresosTipoB1, @salidasTipoB1 := salidasTipoB1,
        @ingresosTipoC := ingresosTipoC, @salidasTipoc:= salidasTipoc 
        FROM `stock_mensual_hi` WHERE idLote = p1 and fechaRegistro LIKE CONCAT('%',@ym,'%');        

        set @saldoFinTipoA = @saldoFinTipoA_ant + @ingresosTipoA - @salidasTipoA;
        set @saldoFinTipoB = @saldoFinTipoB_ant + @ingresosTipoB - @salidasTipoB;
        set @saldoFinTipoB1 = @saldoFinTipoB1_ant + @ingresosTipoB1 - @salidasTipoB1;
        set @saldoFinTipoC = @saldoFinTipoC_ant + @ingresosTipoC - @salidasTipoC;
        
        UPDATE stock_mensual_hi set 
        saldoIniTipoA = @saldoFinTipoA_ant, ingresosTipoA = @ingresosTipoA, salidasTipoA = @salidasTipoA, saldoFinTipoA = @saldoFinTipoA,
        saldoIniTipoB = @saldoFinTipoB_ant, ingresosTipoB = @ingresosTipoB, salidasTipoB = @salidasTipoB, saldoFinTipoB = @saldoFinTipoB,
        saldoIniTipoB1 = @saldoFinTipoB1_ant, ingresosTipoB1 = @ingresosTipoB1, salidasTipoB1 = @salidasTipoB1, saldoFinTipoB1 = @saldoFinTipoB1,
        saldoIniTipoC = @saldoFinTipoC_ant, ingresosTipoC = @ingresosTipoC, salidasTipoC = @salidasTipoC, saldoFinTipoC = @saldoFinTipoC
        WHERE idStockMensualHI = @value;

    END IF;

    SET @myArrayOfValue= SUBSTRING(@myArrayOfValue, LOCATE(',',@myArrayOfValue) + 1);

END WHILE;

END IF;

